pragma solidity ^0.8.0;

import "../agnostic/Array.sol";
import "../Repository/Repository.sol";
import "../agnostic/UIntConverter.sol";
import "../Market/Order/Lib.sol";

bytes32 constant DELIVERY = keccak256("Delivery");

contract Delivery is RepositoryContract, UIntConverter {

    function id() public view returns (bytes32) {return DELIVERY;}


    constructor(Repository rep_) RepositoryContract(rep_) {}

    function orderDeliveryCompatible(
        Order.Info memory _order,
        uint256[] memory _delivery
    ) public pure returns (bool) {
        return true;
    }

    function deliveryCompatible(
        uint256[] memory _delivery1,
        uint256[] memory _delivery2
    ) public pure returns (bool) {
        return true;
    }
}
